package java_fundamentals;
import java.util.*;
public class Question5 {

	public static void main(String[] args) {
         		// TODO Auto-generated method stub
		Scanner in=new Scanner(System.in);
		int a=in.nextInt();
		if(a%2==0) {
			System.out.println("Even");
		}else {
			System.out.println("Odd");
		}
		in.close();
	}

}
